Phaserfroot.PluginManager.register(
  "duck_gfbjs",
  class duck_gfbjs extends Phaserfroot.Component {
    constructor( target, instanceProperties ) {
      super( {
        name: "duck_gfbjs",
        owner: target,
      } );
      this.instanceProperties = instanceProperties;
      this.scene = target.scene;
      this.game = target.scene.game;

      this.owner.once( "levelSwitch", this.destroy, this );

      // Attach custom event listeners.
      this.scene.getKey( 83 ).on( "up", this.onKeyInput83, this );
      this.scene.getKey( 87 ).on( "up", this.onKeyInput87, this );
      this.scene.getKey( 65 ).on( "up", this.onKeyInput65, this );
      this.scene.input.keyboard.on( "keydown", this.onKeyInputAny, this );
      this.scene.getKey( 68 ).on( "up", this.onKeyInput68, this );
      this.scene.getKey( 32 ).on( "up", this.onKeyInput32, this );


      // Initialize properties from parameters.
      this.toucher = ( typeof instanceProperties[ "toucher" ] !== "undefined" ) ? this.scene.getChildById( instanceProperties[ "toucher" ], true ) : null;
      this.IsJumping = instanceProperties[ "IsJumping" ];


      // Boot phase.
      this.camera = this.scene.cameras.main;

      this.onCreate();

    }

    // BUILT-IN METHODS

    preUpdate () {

    }

    update () {
      this.EVENTS_UPDATE();
      this.EVENTS_UPDATE2();
      this.EVENTS_UPDATE3();
      this.EVENTS_UPDATE4();

    }

    postUpdate () {

    }

    destroy () {
      this.owner.off( "levelSwitch", this.destroy, this );

      // Detach custom event listeners.
      this.scene.getKey( 83 ).off( "up", this.onKeyInput83, this );
      this.scene.getKey( 87 ).off( "up", this.onKeyInput87, this );
      this.scene.getKey( 65 ).off( "up", this.onKeyInput65, this );
      this.scene.input.keyboard.off( "keydown", this.onKeyInputAny, this );
      this.scene.getKey( 68 ).off( "up", this.onKeyInput68, this );
      this.scene.getKey( 32 ).off( "up", this.onKeyInput32, this );
      if ( this.delayed_event ) this.delayed_event.remove();

    }

    // CUSTOM METHODS

    onCreate () {
      // Executed when this script is initially created.
      this.owner.tags.add( 'player' );
    }

    EVENTS_UPDATE () {
      // Executed every frame.
      if (( this.scene.getKey( 87 ).isDown || this.scene._keys.lastPressed === 87 )) {
        this.owner.body.velocity.y = (-150);
        this.owner.playMy( 'walkUp' );
        if (( this.scene.getKey( 16 ).isDown || this.scene._keys.lastPressed === 16 )) {
          this.owner.body.velocity.y = (-325);
        }
        if (( this.scene.getKey( 32 ).isDown || this.scene._keys.lastPressed === 32 )) {
          this.owner.playMy( 'hitUp' );
        }
      } else if (( this.scene.getKey( 65 ).isDown || this.scene._keys.lastPressed === 65 )) {
        this.owner.body.velocity.x = (-150);
        this.owner.playMy( 'walkLeft' );
        if (( this.scene.getKey( 16 ).isDown || this.scene._keys.lastPressed === 16 )) {
          this.owner.body.velocity.x = (-325);
        }
        if (( this.scene.getKey( 32 ).isDown || this.scene._keys.lastPressed === 32 )) {
          this.owner.playMy( 'hitLeft' );
        }
      } else if (( this.scene.getKey( 32 ).isDown || this.scene._keys.lastPressed === 32 )) {
        this.owner.playMy( 'hitDown' );
      } else if (( this.scene.getKey( 83 ).isDown || this.scene._keys.lastPressed === 83 )) {
        this.owner.body.velocity.y = 150;
        this.owner.playMy( 'walkDown' );
        if (( this.scene.getKey( 16 ).isDown || this.scene._keys.lastPressed === 16 )) {
          this.owner.body.velocity.y = 325;
        }
        if (( this.scene.getKey( 32 ).isDown || this.scene._keys.lastPressed === 32 )) {
          this.owner.playMy( 'hitLeft' );
        }
      } else if (( this.scene.getKey( 68 ).isDown || this.scene._keys.lastPressed === 68 )) {
        this.owner.body.velocity.x = 150;
        this.owner.playMy( 'walkRight' );
        if (( this.scene.getKey( 16 ).isDown || this.scene._keys.lastPressed === 16 )) {
          this.owner.body.velocity.x = 325;
        }
        if (( this.scene.getKey( 32 ).isDown || this.scene._keys.lastPressed === 32 )) {
          this.owner.playMy( 'hitRight' );
        }
      }
    }

    EVENTS_UPDATE2 () {
      // Executed every frame.
      this.camera.centerOn( this.owner.x, this.owner.y );
    }

    onKeyInput83 () {
      this.owner.body.velocity.y = 0;
      this.owner.playMy( 'idleDown' );
    }

    onKeyInput87 () {
      this.owner.body.velocity.y = 0;
      this.owner.playMy( 'idleUp' );
    }

    onKeyInput65 () {
      this.owner.body.velocity.x = 0;
      this.owner.playMy( 'idleLeft' );
    }

    onKeyInputAny () {
    }

    onKeyInput68 () {
      this.owner.body.velocity.x = 0;
      this.owner.playMy( 'idleRight' );
    }

    onKeyInput32 () {
      this.owner.playMy( 'idleDown' );
    }

    EVENTS_UPDATE3 () {
      // Executed every frame.
      if (( this.scene.getKey( 190 ).isDown || this.scene._keys.lastPressed === 190 )) {
        this.scene.physics.pause();
      }
    }

    EVENTS_UPDATE4 () {
      // Executed every frame.
      if (( this.scene.getKey( 188 ).isDown || this.scene._keys.lastPressed === 188 )) {
        this.scene.physics.resume();
      }
    }

    reportError( message ) {
      message = "(" + this.name.replace( /_[\d]+$/, "" ) + ")" + message;
      console.trace( message );
      this.game.reportError( message, message, "SCRIPT ERROR" );
    }

    errorCheckNotNull( input, backup, message ) {
      if( !input ) {
        this.reportError( message );
        return backup;
      }
      return input;
    }

  }
);

